import React from "react";
import Logo from "../../asset/logo.png";
import styles from "./Sidebar.module.scss";
import NestedList1 from "../NestedList/NestedList1";
import NestedList2 from "../NestedList/NestedList2";
import NestedList3 from "../NestedList/NestedList3";
import NestedList4 from "../NestedList/NestedList4";
import NestedList5 from "../NestedList/NestedList5";
import { useNavigate } from "react-router";

const Sidebar = () => {
  const NestedList1 = () => {
    const navigate = useNavigate();
    const changeNavigate = (route) => {
      navigate(route);
    };
  };

  return (
    <div className={styles.sidebar}>
      <div className={styles.sidebar_div1}>
        <img src={Logo} alt="logo"></img>
        <p>西西の筆記</p>
      </div>
      <NestedList1 navigate={navigate()} />
      <NestedList2 navigate={navigate()} />
      <NestedList3 navigate={navigate()} />
      <NestedList4 navigate={navigate()} />
      <NestedList5 navigate={navigate()} />
    </div>
  );
};

export default Sidebar;
// React介紹 流程 安裝
